//lint:file-ignore SA4003
package main

import (
	"encoding/json"
	"fmt"
	"log"

	"syscall/js"

	"github.com/lvisei/go-kriging/ordinarykriging"
)

// GOOS=js GOARCH=wasm go build -o kriging.wasm

func main() {
	fmt.Println("Instantiate, kriging WebAssembly! v0.0.6")
	done := make(chan int, 0)
	js.Global().Set("OrdinaryKriging", js.FuncOf(OrdinaryKrigingFunc))
	js.Global().Set("OrdinaryKrigingTrain", js.FuncOf(OrdinaryKrigingTrainFunc))
	<-done
}

func OrdinaryKrigingFunc(this js.Value, args []js.Value) interface{} {
	values := make([]float64, args[0].Length())
	for i := 0; i < len(values); i++ {
		values[i] = args[0].Index(i).Float()
	}
	lons := make([]float64, args[1].Length())
	for i := 0; i < len(lons); i++ {
		lons[i] = args[1].Index(i).Float()
	}
	lats := make([]float64, args[2].Length())
	for i := 0; i < len(lats); i++ {
		lats[i] = args[2].Index(i).Float()
	}
	model := args[3].String()
	sigma2 := args[4].Float()
	alpha := args[5].Float()
	width := args[6].Float()

	geoJsonString := args[7].String()
	polygon, err := readPolygonBytes([]byte(geoJsonString))
	if err != nil {
		log.Fatal(err)
	}

	gridMatrices := RunOrdinaryKriging(values, lons, lats, model, sigma2, alpha, width, polygon)

	gridBuffer, err := json.Marshal(gridMatrices)
	if err != nil {
		log.Fatal(err)
	}

	//js.Global().Get("console").Call("log", "wasm geoJsonString: ", js.ValueOf(geoJsonString))
	//js.Global().Get("console").Call("log", "wasm gridMatrices: ", string(gridBuffer))
	return string(gridBuffer)
}

func OrdinaryKrigingTrainFunc(this js.Value, args []js.Value) interface{} {
	values := make([]float64, args[0].Length())
	for i := 0; i < len(values); i++ {
		values[i] = args[0].Index(i).Float()
	}
	lons := make([]float64, args[1].Length())
	for i := 0; i < len(lons); i++ {
		lons[i] = args[1].Index(i).Float()
	}
	lats := make([]float64, args[2].Length())
	for i := 0; i < len(lats); i++ {
		lats[i] = args[2].Index(i).Float()
	}
	model := args[3].String()
	sigma2 := args[4].Float()
	alpha := args[5].Float()

	variogram := RunOrdinaryKrigingTrain(values, lons, lats, model, sigma2, alpha)
	variogramBuffer, err := json.Marshal(variogram)
	if err != nil {
		log.Fatal(err)
	}

	//js.Global().Get("console").Call("log", "wasm variogram: ", string(variogramBuffer))
	return string(variogramBuffer)
}

func RunOrdinaryKrigingTrain(values, lons, lats []float64, model string, sigma2 float64, alpha float64) *ordinarykriging.Variogram {
	ordinaryKriging := ordinarykriging.NewOrdinary(values, lons, lats)
	variogram, err := ordinaryKriging.Train(ordinarykriging.ModelType(model), sigma2, alpha)
	if err != nil {
		log.Fatal(err)
	}
	return variogram
}

func RunOrdinaryKriging(values, lons, lats []float64, model string, sigma2, alpha, width float64, polygon ordinarykriging.PolygonCoordinates) *ordinarykriging.GridMatrices {
	ordinaryKriging := ordinarykriging.NewOrdinary(values, lons, lats)
	if _, err := ordinaryKriging.Train(ordinarykriging.ModelType(model), sigma2, alpha); err != nil {
		log.Fatal(err)
	}
	return ordinaryKriging.Grid(polygon, width)
}

func readPolygonBytes(content []byte) (ordinarykriging.PolygonCoordinates, error) {
	var polygonGeometry ordinarykriging.PolygonGeometry
	err := json.Unmarshal(content, &polygonGeometry)
	if err != nil {
		log.Fatalf("invalid json: %v", err)
		return nil, err
	}

	return polygonGeometry.Coordinates, nil
}

